import React from 'react';

class Charts extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
    }
  }

  componentDidMount() {
    fetch("https://sheetdb.io/api/v1/hse3ttfafjgip")
      .then((response) => {
        return response.json()
      }).then((json) => {
        this.setState({data: json});
      });
  }

  renderData() {
    return this.state.data.map((row) => 
    <div>
      <p>{row.module}</p>
      <p>{row.instructions}</p>
    </div>
    );
  }

  render() {
    return(
      <div>
        {this.renderData()}
      </div>
    )
  }
}

export default Charts;
